    return (
        <div className="movie">
            <p>{props.title}</p>
            <p>{props.year}</p>
            <p>{props.director}</p>
            <p>{props.duration}</p>
            <p>{props.genre}</p>
            <p>{props.rate}</p>
            <p>{props.genre.map((elt) => <p></p>)}</p>

        </div>
    );
}

export default MovieItem;
